import './App.css';

function App() {
  return (
    <>
      <BrowserRouter>
        <Suspense>
          <Routes>
            <Route exact path='/' element={<PublicLayouts />}>
              <Route index element={<Navigate to='/login' />} />

              {PublicRoutes.map((route, idx) => {
                return (
                  route.Component && (
                    <Route
                      key={idx}
                      path={route.path}
                      exact={route.exact}
                      name={route.name}
                      element={<route.Component />}
                    />
                  )
                )
              })}
            </Route>
          </Routes>
        </Suspense>
      </BrowserRouter>
    </>
  );
}

export default App;
